import LogoImg from "../images/logo.png";
import "../css/common.css";

function Header() {
  return (
    <div>
      <header>
        <div class="head_area">
          <Link to="/AddItem" id="logo">
            <img src={LogoImg} alt="로고 이미지" />
          </Link>
          <Link to="/AddItem" id="logo">
            <p>자유게시판</p>
          </Link>
          <Link to="/AddItem" id="logo">
            <p className="active">중고마켓</p>
          </Link>
          <a href="./member/login.html" id="login">
            로그인
          </a>
        </div>
      </header>
    </div>
  );
}

export default Header;
